class Solution {
public:
    int calculate(string s) {
        int len = s.size();
        if(len == 0) return 0;
        stack<int> nums;
        stack<char> ops;
        int num = 0;
        for(int i = 0; i < len; i++) {
            if(s[i] == ' ') continue;
            if(s[i] >= '0' && s[i] <= '9') {
                num = num * 10 + s[i] - '0';
            } else {
                if(!ops.empty() && ops.top() != '(' && hasPrecedence(s[i], ops.top())) {
                    int op2 = nums.top();
                    nums.pop();
                    int op1 = nums.top();
                    nums.pop();
                    char op = ops.top();
                    ops.pop();
                    nums.push(applyOp(op1, op2, op));
                }
                ops.push(s[i]);
                num = 0;
            }
        }
        while(!ops.empty()) {
            int op2 = nums.top();
            nums.pop();
            int op1 = nums.top();
            nums.pop();
            char op = ops.top();
            ops.pop();
            nums.push(applyOp(op1, op2, op));
        }
        return nums.top();
    }

    bool hasPrecedence(char op1, char op2) {
        if(op2 == '(' || op2 == ')') return false;
        if((op1 == '*' || op1 == '/') && (op2 == '+' || op2 == '-')) return false;
        return true;
    }

    int applyOp(int op1, int op2, char op) {
        switch(op) {
            case '+':
                return op1 + op2;
            case '-':
                return op1 - op2;
            case '*':
                return op1 * op2;
            case '/':
                return op1 / op2;
        }
        return 0;
    }
};

