public:
    int calculate(string s) {
        int result = 0, sign = 1, num = 0;
        stack<int> stk;
        for (int i = 0; i < s.size(); i++) {
            if (s[i] >= '0') {
                num = num * 10 + s[i] - '0';
            } else if (s[i] == '+') {
                result += sign * num;
                num = 0;
                sign = 1;
            } else if (s[i] == '-') {
                result += sign * num;
                num = 0;
                sign = -1;
            } else if (s[i] == '(') {
                stk.push(result);
                stk.push(sign);
                result = 0;
                sign = 1;
            } else if (s[i] == ')') {
                result += sign * num;
                num = 0;
                result *= stk.top();
                stk.pop();
                result += stk.top();
                stk.pop();
            }
        }
        if (num != 0) {
            result += sign * num;
        }
        return result;
    }
};
